// src/components/DisplayMembers.js
import React, { useEffect, useState } from "react";
import axios from "axios";

function DisplayMembers() {
  const [members, setMembers] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    axios
      .get("http://localhost:5000/users/family", { withCredentials: true })
      .then((res) => setMembers(res.data))
      .catch((err) => setError("Failed to fetch family members"));
  }, []);

  return (
    <div>
      <h2>Family Members</h2>
      {error && <p style={{ color: "red" }}>{error}</p>}
      {members.length === 0 && <p>No family members found.</p>}
      <ul>
        {members.map((m) => (
          <li key={m._id}>
            <b>{m.role}</b>: {m.name} ({m.age} years) - {m.address}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DisplayMembers;
